CREATE EXTENSION postgis;

SET CLIENT_ENCODING TO UTF8;
SET STANDARD_CONFORMING_STRINGS TO ON;
SET CLIENT_MIN_MESSAGES = 'ERROR';

BEGIN;
CREATE TABLE "nyc_bike_racks" (gid serial,
"name" varchar(254),
"small" numeric(10,0),
"large" numeric(10,0),
"circular" numeric(10,0),
"mini_hoop" numeric(10,0),
"total_rack" numeric(10,0));
ALTER TABLE "nyc_bike_racks" ADD PRIMARY KEY (gid);
SELECT AddGeometryColumn('','nyc_bike_racks','geom','4326','POINT',4);
CREATE INDEX ON "nyc_bike_racks" USING GIST ("geom");
COMMIT;
ANALYZE "nyc_bike_racks";
